import img7 from '../Images/11221.jpeg';
import img8 from '../Images/11222.jpeg';
import img9 from '../Images/11223.jpeg';
import img10 from '../Images/11224.jpeg';
import img11 from '../Images/11.jpeg';
import img12 from '../Images/12.jpeg';
import img13 from '../Images/13.jpeg';
import img14 from '../Images/14.jpeg';
import img15 from '../Images/15.jpeg';
import img16 from '../Images/16.jpeg';
function Achivements() {
    return (
        <div>
            <section className="bg-gray-900 text-gray-100" id="Achivements">
                <div className="container mx-auto py-16 px-10 sm:pl-0 md:pl-80 lg:md:pl-80">
                    <h1 className="text-3xl font-bold text-gray-100 text-center mb-1"><span className="text-yellow-400">My</span> Achivements</h1>
                    <div className="w-full h-px bg-gray-800"></div>
                    <div className="grid grid-flow-cols grid-cols-1 sm:grid-cols-3 md:grid-cols-3 lg:grid-cols-3 gap-8 pt-10 ">
                        <div className='w-60'>
                            <img src={img7} alt="" className="bg-gray-200 py-1 px-1 img-box" />
                            <a href={img7} className="text-xs text-gray-300 border-p">Clone of Tailblocks Desigen</a>
                        </div>
                        <div className='w-60'>
                            <img src={img8} alt="" className="bg-gray-200 py-1 px-1 img-box" />
                            <a href={img8} className="text-xs text-gray-300 border-p">Clone of Netflix Desigen</a>
                        </div>
                        <div className='w-60'>
                            <img src={img9} alt="" className="bg-gray-200 py-1 px-1 img-box" />
                            <a href={img9} className="text-xs text-gray-300 border-p">Clone of Discord Desigen</a>
                        </div>
                        <div className='w-60'>
                            <img src={img10} alt="" className="bg-gray-200 py-1 px-1 img-box" />
                            <a href={img10} className="text-xs text-gray-300 border-p">Clone of Linkedin Desigen</a>
                        </div>
                        <div className='w-60'>
                            <img src={img13} alt="" className="bg-gray-200 py-1 px-1 img-box" />
                            <a href={img13} className="text-xs text-gray-300 border-p">Clone of Microsoft Desigen</a>
                        </div>
                        <div className='w-60'>
                            <img src={img16} alt="" className="bg-gray-200 py-1 px-1 img-box" />
                            <a href={img16} className="text-xs text-gray-300 border-p">Clone of DesignX Desigen</a>
                        </div>
                    </div>
                </div>
            </section>
        </div>
    );
}
export default Achivements;
